cóyotl is Nahuatl for \"hungry coyote\", it is similar to the seal of Ciudad Nezahualcóyotl.[1][2] The station was opened on 30 November 2000.[3]\r\n\r\nFrom 2000 to 2002 the station name was Continentes (Spanish for \"continents\"), due to the station being near the Boulevard de los Continentes, and the icon of the station was a Mollweide projection. In 2002, it was decided to change the name of the station to Nezahualcóyotl, to reflect the name of the municipality that is crossed by this specific station.[4]\r\n\r\nExits\r\nNorth: Av. Central and Boulevard de los Continentes, Col. Vergel de Guadalupe\r\nNortheast: Av. Central and Boulevard de los Continentes, Col. Vergel de Guadalupe\r\nSouth: Av. Central and Av. Jorge Jiménez Cantú, Col. Vergel de Guadalupe\r\nSoutheast: Av. Central and Av. Jorge Jiménez Cantú, Col. Vergel de Guadalupe\r\nReferences\r\n \"Nezahualcóyotl\" (in Spanish). Archived from the original on 27 April 2011. Retrieved 5 August 2011.\r\n Archambault, Richard. \"Nezahualcóyotl » Mexico City Metro System\". Retrieved 5 August 2011.\r\n Monroy, Marco. Schwandl, Robert (ed.). \"Opening Dates for Mexico City\'s Subway\". Retrieved 5 August 2011.\r\n \"¿Por qué algunas estaciones del Metro cambiaron de nombre?\". El Universal (in Spanish). July 14, 2017. Retrieved August 21, 2018.\r\nhttps://www.eluniversal.com.mx/entrada-de-opinion/colaboracion/mochilazo-en-el-tiempo/nacion/sociedad/2017/07/14/por-que-algunas\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:1817:\"<p>Nezahualcóyotl is a station on Line B of the Mexico City Metro system.[1][2] It is located in Ciudad Nezahualcóyotl in the State of Mexico adjacent to Mexico City.[1]</p>\n<p>The logo for the station is the head of a coyote since Nezahualcóyotl is Nahuatl for \"hungry coyote\", it is similar to the seal of Ciudad Nezahualcóyotl.[1][2] The station was opened on 30 November 2000.[3]</p>\n<p>From 2000 to 2002 the station name was Continentes (Spanish for \"continents\"), due to the station being near the Boulevard de los Continentes, and the icon of the station was a Mollweide projection. In 2002, it was decided to change the name of the station to Nezahualcóyotl, to reflect the name of the municipality that is crossed by this specific station.[4]</p>\n<p>Exits<br />\nNorth: Av. Central and Boulevard de los Continentes, Col. Vergel de Guadalupe<br />\nNortheast: Av. Central and Boulevard de los Continentes, Col. Vergel de Guadalupe<br />\nSouth: Av. Central and Av. Jorge Jiménez Cantú, Col. Vergel de Guadalupe<br />\nSoutheast: Av. Central and Av. Jorge Jiménez Cantú, Col. Vergel de Guadalupe<br />\nReferences<br />\n \"Nezahualcóyotl\" (in Spanish). Archived from the original on 27 April 2011. Retrieved 5 August 2011.<br />\n Archambault, Richard. \"Nezahualcóyotl » Mexico City Metro System\". Retrieved 5 August 2011.<br />\n Monroy, Marco. Schwandl, Robert (ed.). \"Opening Dates for Mexico City\'s Subway\". Retrieved 5 August 2011.<br />\n \"¿Por qué algunas estaciones del Metro cambiaron de nombre?\". El Universal (in Spanish). July 14, 2017. Retrieved August 21, 2018.<br />\n<a href=\"https://www.eluniversal.com.mx/entrada-de-opinion/colaboracion/mochilazo-en-el-tiempo/nacion/sociedad/2017/07/14/por-que-algunas\">https://www.eluniversal.com.mx/entrada-de-opinion/colaboracion/mochilazo...</a></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:18:\"field_logo_oficial\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"2\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:41:\"Screen Shot 2020-01-29 at 10.32.55 AM.png\";s:3:\"uri\";s:50:\"public://Screen Shot 2020-01-29 at 10.32.55 AM.png\";s:8:\"filemime\";s:9:\"image/png\";s:8:\"filesize\";s:5:\"15400\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1580315663\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:3:\"594\";s:6:\"height\";s:2:\"70\";}}}s:22:\"field_logo_publicacion\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"1\";s:3:\