INSERT INTO `search_dataset` VALUES (1,'node',' metro nezahualcóyotl nezahualcóyotl is a station on line b of the mexico city metro system 12 it is located in ciudad nezahualcóyotl in the state of mexico adjacent to mexico city 1 the logo for the station is the head of a coyote since nezahualcóyotl is nahuatl for hungry coyote it is similar to the seal of ciudad nezahualcóyotl 12 the station was opened on 30 november 20003 from 2000 to 2002 the station name was continentes spanish for continents due to the station being near the boulevard de los continentes and the icon of the station was a mollweide projection in 2002 it was decided to change the name of the station to nezahualcóyotl to reflect the name of the municipality that is crossed by this specific station 4 exits north av central and boulevard de los continentes col vergel de guadalupe northeast av central and boulevard de los continentes col vergel de guadalupe south av central and av jorge jiménez cantú col vergel de guadalupe southeast av central and av jorge jiménez cantú col vergel de guadalupe references nezahualcóyotl in spanish archived from the original on 27 april 2011 retrieved 5 august 2011 archambault richard nezahualcóyotl mexico city metro system retrieved 5 august 2011 monroy marco schwandl robert ed opening dates for mexico city s subway retrieved 5 august 2011 por qué algunas estaciones del metro cambiaron de nombre el universal in spanish july 14 2017 retrieved august 21 2018 https wwweluniversalcommx entradadeopinion colaboracion mochilazo  ',1580339721);
